    render()
    {
        return(
            <>

            <h2>{this.props.title}</h2>
            <img 
            src={this.props.image_url} 
            alt={this.props.description} 
            title={this.props.title}></img>
            {/* help from Raul */}
            </>
        );
        <p> </p>
    }
}
